import React from 'react'
import { FaBeer } from "@react-icons/all-files/fa/FaBeer";
const Icons = (props) => { 
   
  return (
    <div>
      <div style={{"--color": prop}} class="file-icons"><FaBeer /></div>
    </div>
  )
}

export default Icons
